// src/components/DashboardContainer.js
import React from 'react';
import FileUploader from './FileUploader';

const DashboardContainer = () => {
  // Define the callback function for handling file upload success
  const handleFileUploadSuccess = (file) => {
    console.log('File uploaded:', file.name); // Log the name of the uploaded file
  };

  return (
    <div style={{ padding: 20 }}>
      <h2>File Uploader Test</h2>
      {/* Include the FileUploader component and pass the callback function */}
      <FileUploader onUploadSuccess={handleFileUploadSuccess} />
    </div>
  );
};

export default DashboardContainer;
